CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAllCourseInfor` ()   BEGIN
SELECT *, co.name as course_name, staff.name as staff_name FROM
(
	SELECT branch.address, withbranchid.* FROM branch
	INNER JOIN (
		SELECT at.branch_id, withclassdate.* FROM at
		INNER JOIN (
			SELECT temp.class_date, course.* FROM course
			INNER JOIN(
			SELECT * FROM schedule
			) temp
			ON temp.course_id = course.course_id
		) withclassdate
		ON withclassdate.course_id = at.course_id
	) as withbranchid
	ON withbranchid.branch_id = branch.branch_id
) co
INNER JOIN staff
ON co.manager_id = staff.staff_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAllCourseInforFilter` (`nameIn` CHAR(100), `levelIn` CHAR(100))   BEGIN
SELECT *, co.name as course_name, staff.name as staff_name FROM
(
	SELECT branch.address, withbranchid.* FROM branch
	INNER JOIN (
		SELECT at.branch_id, withclassdate.* FROM at
		INNER JOIN (
			SELECT temp.class_date, course.* FROM course
			INNER JOIN(
			SELECT * FROM schedule
			) temp
			ON temp.course_id = course.course_id
			WHERE name = nameIn AND level = levelIn
		) withclassdate
		ON withclassdate.course_id = at.course_id
	) as withbranchid
	ON withbranchid.branch_id = branch.branch_id
) co
INNER JOIN staff
ON co.manager_id = staff.staff_id;
END$$

